// import logo from './logo.svg';
import './App.css';
import Aboutus from './components/layouts/Aboutsus';
import Contactus from './components/layouts/Contactus';
import Landing from './components/layouts/Landing';
import {  BrowserRouter as Router,Route , Routes} from "react-router-dom";
import Home from './components/layouts/Home';
function App() {

  return (
  <>
    <BrowserRouter> 

  <Routes>


<Router>
  <switch>
    <Route path="/" component={Home} exact > <Home/> </Route>
    <Route path="/aboutus" component={Aboutus} exact > <Aboutus/> </Route>
    <Route path="/landing" component={Landing} exact > <Landing/> </Route>
    <Route path="/contactus" component={Contactus} exact > <Contactus/> </Route>
  </switch>
</Router>

</Routes>
</BrowserRouter>
  </>
  );
}

export default App;
